import { requestRegisterUserValentano } from "../../anstanceUrl/request"
import { axiosInstance } from "../../anstanceUrl/urlInstance"



export const AllFunction = {
    register: (data) => {

        return axiosInstance({
            url: requestRegisterUserValentano.registerUserValentano,
            method: 'post',
            credentials: 'include',
            body: data
        }).then((res) => {
            return res
        }).catch((err) => {
            return err
        })
    },

    login: (data,viewport) => {
        console.log(data)
        console.log()
        return axiosInstance({
            url: `${requestRegisterUserValentano.loginUserValentano}/?viewport=${viewport}`,
            method: 'post',
            credentials: 'include',
             data,viewport
        }).then((res) => {
            console.log(res)
            return res.data.user.user
        }).catch((err) => {
            return err
        })
    },

    ///////////////this function for ragazzo

    loginRagazzo:(data)=>{
        return axiosInstance({
            url:requestRegisterUserValentano.loginRagazzoValentano,
            method:'post',
            credentials:'include',
            data
        })
    }
}
